route_south_downs = Route.create!(user: user, name: "South Downs Way", description: "This undulating route follows footpaths and bridleways. It is the perfect way to explore the chalk downland countryside, and coastline, of the South Downs National Park. Despite its proximity to London and Brighton the South Downs National Park feels a million miles away from modern hubbub. Leave it behind as you follow the route onto the ridgeline, and enjoy the spectacular views. If you get a clear evening, head out to a section of the trail at night for some of the best star gazing opportunities England offers.")
route_cotswold_way = Route.create!(user: user, name: "Cotswold Way", description: "The Cotswold Way meanders along the Cotswold escarpment, providing 102 miles of fantastic views. The surrounding landscape is an Area of Outstanding Natural Beauty. It offers a mix of pastoral scenes, parkland, woodland, stone-built cottages, and historic sites. Many of the villages and towns through which the trail passes were built on the wealth of the wool trade in the 17th century. Today you’ll find fewer working mills, but the striking golden-hued 17th century architecture remains. The Cotswold Way joins Chipping Campden, one of the Cotswold’s prettiest towns, to Bath, the historic spa town. So if you want to extend your stay to soak up some culture, or soak your weary muscles, you’ll be spoilt for choice.")
route_the_ridgeway = Route.create!(user: user, name: "The Ridgeway", description: "Lorem Ipsum is simply dummy text of the printing and typesetting industry. Lorem Ipsum has been the industry's standard dummy text ever since the 1500s, when an unknown printer took a galley of type and scrambled it to make a type specimen book. It has survived not only five centuries, but also the leap into electronic typesetting, remaining essentially unchanged. It was popularised in the 1960s with the release of Letraset sheets containing Lorem Ipsum passages, and more recently with desktop publishing software like Aldus PageMaker including versions of Lorem Ipsum.")
route_hadrians_wall = Route.create!(user: user, name: "Hadrian's Wall Path", description: "This trail is truly unique, offering city, country and ancient history along its route. Hadrian’s Wall is the largest Roman artefact remaining anywhere today. Built in 122AD, this extraordinary structure is still in remarkable condition in places. This trail allows you to explore the length of the wall from coast to coast, linking the vibrant cities of Carlisle and Newcastle. Along the route you’ll pass through beautiful rolling hills and rugged moorland. Whilst walking the trail, you’ll encounter many Roman settlements and forts dotted along its length. If you’re interested in exploring these sites and museums further, make sure you allow yourself more time.")

